scores = []
prior_max = -60000

for i in range(0,100000):
    # Create the game
    g = Game.fromfile('map.txt', True)

    g.add_monster(SelfPreservingMonster("monster", # name
                                    "M",       # avatar
                                    2, 2,      # position
                                    1          # detection range
))

    
    t = TestCharacter("me", # name
                                  "C",  # avatar
                                  0, 0,  # position
                                  states 
    )

    # TODO Add your character
    g.add_character(t)
    
    #print(states[getState(g.world, t, 5)])
    #time.sleep(10)
    
    # Run!
    g.go()

    state = getState(g.world, t, 3)
    if state in t.updated_states:
        if t.last_move in t.updated_states[state]:
            t.updated_states[state][t.last_move] = (t.updated_states[state][t.last_move][0]+1, 0)
        else:
            t.updated_states[state][t.last_move] = (1, 0)
    else:
        t.updated_states[state] = {t.last_move: (1, 0)}
    
    score = g.world.scores["me"] - (5000-g.world.time)
    scores += [score]
    updated_states = t.updated_states
    
    for state, moves in updated_states.items():
        for move, values in moves.items():
            updated_states[state][move] = (updated_states[state][move][0], score)
    
    for state, moves in updated_states.items():
        if state in states:
            for move, values in moves.items():
                if move in states[state]:
                    states[state][move] = (states[state][move][0] + values[0], (states[state][move][0]*states[state][move][1] + values[0]*score)/(float(states[state][move][0] + values[0])))
                    #states[state][move] = (states[state][move][0] + values[0], (max(states[state][move][1],score)))
                else:
                    states[state][move] = values
        else:
            states[state] = moves
    
    if max(scores) > prior_max:
        prior_max = max(scores)
    #print("{}: {}".format(i,score))
    #if prior_max > 0:
     #   break
    if len(scores) > 10:
        if sum(scores[-10:])/10.0 > 0:
            #print(states)
            
            print("{}: {}".format(i, sum(scores[-10:])/10.0))
    
